import { useState, useEffect } from "react";
import { getVoter } from "../../Api/ApiHandler";
const ManageVoter = (props) => {
  // defining states
  const [voterData, setVoterData] = useState([]);

  const token = props.token;
  useEffect(() => {
    getVoter(token).then((response) => {
      setVoterData(response.data);
    });
  }, [token]);
  return (
    <table class="styled-table">
      <thead>
        <tr>
          <th>S.N</th>
          <th>Name</th>
          <th>Address</th>
          <th>Email</th>
          <th>DOB</th>
          <th>Action</th>
        </tr>
      </thead>
      <tbody>
        {voterData.map((item) => {
          return (
            <tr>
              <td>{item.v_id}</td>
              <td>{item.name}</td>
              <td>{item.address}</td>
              <td>{item.email}</td>
              <td>{item.dob}</td>
              <td class="action">Delete</td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

export default ManageVoter;
